function Foot(props) {
    // console.log("Foot",props)
    const {finishedCount,totalCount,dealSelectedAllTodo} = props;
    const _dealClick = ()=> {
        console.log('dealclick')
    }
    return (
        <div className="todo-footer">
                <label>
                    <input
                        type="checkbox"
                        checked={finishedCount === totalCount}
                    />
                </label>
                <span><span>已完成{finishedCount}件</span> / 总计{totalCount}件</span>
                <button
                    className="btn btn-warning"
                    onClick={()=>_dealClick()}
                >
                    清除已完成任务
                </button>
            </div>
    )
}

export default Foot
